import crypto from "crypto-js";

export function Cipher(stc, key) {
  const cryptoInfo = crypto.AES.encrypt(
    JSON.stringify({ str }),
    key
  ).toString();

  console.log({ cryptoInfo });
}

export function Decipher(str, key) {
  const info2 = crypto.AES.decrypt(str, key).toString(crypto.enc.Utf8);
  console.log({ info2 });
}
